// SPDX-License-Identifier:GPL-3.0-only
pragma solidity >=0.7.6;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "./otpWallet.sol";
import "./external/walletproxy.sol";
import "./external/create2.sol";
import "./external/signatureutil.sol";

contract WalletFactory is Ownable {
	using Address for address payable;

	event CreateWallet(address wallet, address owner, string[2] domain);
	event InitialPortfolioFunding(address wallet, FundToken fundedToken);
	event Received(address indexed _from, uint256 _value);
	event Withdrawn(
		address indexed _to,
		address indexed _tokenAddress,
		uint256 _value,
		bool success
	);

	event Debug(bytes32 signHash, address addr);
	event Log(string logMessage);

	address public immutable walletImplementation;
	string public constant WALLET_CREATION = "WALLET_CREATION";
	uint256 public feeAmount = 0.09 ether; // 0.09 ONE
	uint256 public freeUserCap = 1000;

	struct CreateRecord {
		address wallet;
		string[2] domain;
	}

	struct FundToken {
		address tokenAddress;
		uint256 tokenAmount;
	}

	CreateRecord[] public created;
	mapping(address => mapping(address => FundToken)) public walletTokenMap; // mapping walletAddress to map of FundToken to map of Token

	// TODO: Remove dailyLimit for initial setup
	struct WalletConfig {
		address resolver;
		string[2] domain;
		address owner;
		bytes32[] rootHash;
		uint8 merkleHeight;
		address drainAddr;
		uint256 dailyLimit;
		uint256 salt;
		// address feeReceipient;
		// uint256 feeAmount;
	}

	constructor(address _walletImplementation) {
		walletImplementation = _walletImplementation;
	}

	// TODO: See if there is a cleaner way to receive
	// TODO: Fix emit event for fallback function
	receive() external payable {
		emit Received(msg.sender, msg.value);
	}

	function withdraw(address payable to) external onlyOwner {
		uint256 balance = address(this).balance;
		payable(to).sendValue(balance);
		// TODO: Check if sendValue returns sth or is reverted
		emit Withdrawn(
			to,
			0x0000000000000000000000000000000000000000,
			balance,
			true
		);
	}

	function withdrawErc20(address tokenAddress, address payable to)
		external
		onlyOwner
	{
		uint256 balance = IERC20(tokenAddress).balanceOf(address(this));
		bool sent = IERC20(tokenAddress).transfer(to, balance);

		emit Withdrawn(to, tokenAddress, balance, sent);
		require(sent, "Token withdrawal failed");
	}

	function createWallet(WalletConfig calldata config)
		external
		onlyOwner
		returns (address wallet)
	{
		emit Log("starting to create");

		address addr = computeWalletAddress(config.owner, config.salt);

		emit Log("address computed");

		// set feeAmount to 0 for first 1000 users
		if (created.length > freeUserCap) {
			require(addr.balance >= feeAmount, "NOT ENOUGH FOR FEES");
		} else {
			feeAmount = 0;
		}
		// require(NameRegistry(this).registerName(config.name, addr, 1));

		wallet = _deploy(config.owner, config.salt);
		_initializeWallet(wallet, config);

		created.push(CreateRecord(address(wallet), config.domain));
		emit CreateWallet(address(wallet), config.owner, config.domain);
	}

	// send initial ONE&ERC20 tokens to user's wallet
	function initialPortfolioFunding(
		address wallet,
		FundToken[] calldata fundingTokens,
		uint256 oneAmount
	) external onlyOwner {
		// fund ERC20 tokens
		for (uint256 i = 0; i < fundingTokens.length; i++) {
			FundToken calldata token = fundingTokens[i];
			FundToken memory specificToken = walletTokenMap[wallet][
				token.tokenAddress
			];
			require(specificToken.tokenAmount == 0, "token already funded");

			bool sent = IERC20(token.tokenAddress).transfer(
				wallet,
				token.tokenAmount
			);
			require(sent, "Token transfer failed");

			// TODO: Understand if this needs fixing or only base token / ONE
			walletTokenMap[wallet][token.tokenAddress] = token;
			emit InitialPortfolioFunding(wallet, token);
		}

		FundToken memory oneToken = FundToken({
			tokenAddress: 0x0000000000000000000000000000000000000000,
			tokenAmount: oneAmount
		});

		FundToken memory alreadyFundedToken = walletTokenMap[wallet][
			oneToken.tokenAddress
		];

		require(alreadyFundedToken.tokenAmount == 0, "ONE already funded");

		walletTokenMap[wallet][oneToken.tokenAddress] = oneToken;

		payable(wallet).sendValue(oneAmount);

		// TODO: Move the whole thing to multicall to fix reentrancy issue ?

		emit InitialPortfolioFunding(wallet, oneToken);
	}

	function computeWalletAddress(address owner, uint256 salt)
		public
		view
		returns (address)
	{
		return
			Create2.computeAddress(
				keccak256(abi.encodePacked(WALLET_CREATION, owner, salt)),
				getWalletCode()
			);
	}

	function getCreated() public view returns (CreateRecord[] memory) {
		return created;
	}

	// --- Internal functions ---

	function _initializeWallet(address wallet, WalletConfig calldata config)
		internal
	{
		address feeReceipient = msg.sender;

		TOTPWallet(payable(wallet)).initialize(
			config.resolver,
			config.domain,
			config.owner,
			config.rootHash,
			config.merkleHeight,
			payable(config.drainAddr),
			config.dailyLimit,
			feeReceipient,
			feeAmount
		);

		//TOTPWallet(payable(wallet)).registerENS(config.subdomain, config.domain, config.duration);
	}

	function _deploy(address owner, uint256 salt)
		internal
		returns (address payable wallet)
	{
		// Deploy the wallet proxy
		wallet = Create2.deploy(
			keccak256(abi.encodePacked(WALLET_CREATION, owner, salt)),
			getWalletCode()
		);
	}

	function getWalletCode() internal view returns (bytes memory) {
		return
			abi.encodePacked(
				type(WalletProxy).creationCode,
				abi.encode(walletImplementation)
			);
	}
}
